import React from "react";

const CardsActors = ({ actor }) => {
  return (
    <div className="card-container">
      <div className="img">
        <img
          src={"https://image.tmdb.org/t/p/original" + actor.profile_path}
          alt=""
        />
      </div>
      <div className="infos">
        <h1 className="movie-title">{actor.known_for[0].title}</h1>
        <h5 className="date">{dateFormateur(actor.known_for[1].title)}</h5>
      </div>
    </div>
  );
};

export default CardsActors;
